  styleUrls: ['./about.component.scss']
})
export class AboutComponent {
  face: string = 'https://media.licdn.com/dms/image/D4D03AQEsXxscoeczYA/profile-displayphoto-shrink_800_800/0/1672451889367?e=2147483647&v=beta&t=j6KYFmG1Ey1g9mI3NtW8ZM0QgjE46KMn51tZcXFqjjU'

